import React from "react";
import SHOP_DATA from "../shop/shopData.js";

class ShopPage extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      collection: SHOP_DATA
    };
  }

  render() {
    return <div>
             ShopPage
           </div>;
  }

}

export default ShopPage;
